/api/v1/feed/check/all:
  get:
    tags:
      - Feed
    name: Get all feed
    summary: retrieve all feed
    consumes:
        - application/json
    responses:
      200:
            description: "All Animal Feed"


/api/v1/feed/{id}:
  get:
    tags:
      - Feed
    name: Get feed by id
    summary: retrieve feed by Id
    consumes:
        - application/json
    parameters:
      - name: id
        in: path
        description: ID of feed
        required: true
        schema:
          type: integer
          format: int64
      
    responses:
      200:
            description: "Feed by Id"


  
      